import {React, useState} from 'react'
import "../styles/listing.css"

const CardComponent = (props) => {
  const submitHandler = ({e, property}) => {
    e.preventDefault();
    console.log("****")

    return (
        <div>12345</div>
    )
  }

  return (
    <div className="row row-cols-2 row-cols-md-3 row-cols-lg-4 g-4">
        {props.properties.map((property) => (
            <div className="col">
                <div className="card h-100">
                    <a href='' onClick={submitHandler}><img src={property.img} className="card-img-top" alt="game room"></img></a>
                    <div className="card-body">
                        <h5 className="card-title"><a className='location' href="#">{property.state}, {property.city}</a>
                            <span className="rating"><span className="material-icons">grade</span>{property.score}</span>
                        </h5>
                        <p className="card-text">{property.room_type}<br />$<span
                                className="price">{property.price}</span> per hour</p>
                    </div>
                </div>
            </div>
        ))}
    </div>
  )
}

export default CardComponent
